const container = document.getElementById("container");
const home = document.getElementById("home");
const menu = document.getElementById("menu");
const about = document.getElementById("about-us");

function clearPage() {
  container.innerHTML = "";
}

function createEle(ele) {
  return document.createElement(ele);
}

// Home Page
function createHomePage() {
  clearPage();
  const h1 = createEle("h1");
  h1.classList.add("title");
  h1.textContent = "Eat Healthy - Stay Healthy";
  container.append(h1);

  const p = createEle("p");
  p.classList.add("description");
  p.textContent =
    "Incorporating organic food into your diet can profoundly impact your health and activity levels. Rich in essential nutrients and free from harmful chemicals, organic produce supports optimal physical and mental well-being. By nourishing your body with wholesome ingredients, organic food provides sustained energy, enhances cognitive function, and promotes overall vitality. Additionally, the absence of pesticides and GMOs reduces the risk of chronic illnesses, ensuring long-term health. Whether fueling your workouts or powering through a busy day, choosing organic options empowers you to live a vibrant and active lifestyle.";
  container.append(p);
}

createHomePage();

// Menu Page
function createMenuPage() {
  clearPage();
  const h1 = createEle("h1");
  h1.textContent = "Vitamins";
  h1.classList.add("title");
  container.append(h1);

  const menu = createEle("div");
  menu.setAttribute("id", "menu-container");
  container.appendChild(menu);

  const divArray = [];
  for (let i = 0; i < 13; i++) {
    divArray[i] = createEle("h3");
    divArray[i].classList.add("menu-items");
    menu.appendChild(divArray[i]);
  }

  const vitamins = [
    "Vitamin A",
    "Vitamin B1",
    "Vitamin B2",
    "Vitamin B5",
    "Vitamin B6",
    "Vitamin B7",
    "Vitamin B8",
    "Vitamin B12",
    "Vitamin B15",
    "Vitamin C",
    "Vitamin D",
    "Vitamin E",
    "Vitamin K",
  ];

  for (let i = 0; i < vitamins.length; i++) {
    divArray[i].innerHTML = `${vitamins[i]} <div class="${vitamins[i]}" id="${
      vitamins[i].split(" ")[1]
    }"></div>`;
  }

  const VitaminA = document.getElementById("A");
  const VitaminB1 = document.getElementById("B1");
  const VitaminB2 = document.getElementById("B2");
  const VitaminB5 = document.getElementById("B5");
  const VitaminB6 = document.getElementById("B6");
  const VitaminB7 = document.getElementById("B7");
  const VitaminB8 = document.getElementById("B8");
  const VitaminB12 = document.getElementById("B12");
  const VitaminB15 = document.getElementById("B15");
  const VitaminC = document.getElementById("C");
  const VitaminD = document.getElementById("D");
  const VitaminE = document.getElementById("E");
  const VitaminK = document.getElementById("K");

  VitaminA.innerHTML = `Liver, Sweet Potatoes, Carrots`;
  VitaminB1.innerHTML = `Legumes, Pork, Sunflower seeds, Whole grains`;
  VitaminB2.innerHTML = `Dairy products, Eggs, Lean meats, Green leafy vegetables`;
  VitaminB5.innerHTML = `Avocado, Mushrooms, Sunflower seeds, Chicken`;
  VitaminB6.innerHTML = `Bananas, Chicken, Fish, Potatoes`;
  VitaminB7.innerHTML = `Egg yolks, Nuts, Sweet potatoes, Whole grains`;
  VitaminB8.innerHTML = `Egg yolks, Liver, Soybeans, Peanuts`;
  VitaminB12.innerHTML = `Meat, Fish, Dairy products, Eggs`;
  VitaminB15.innerHTML = `Beef, Pork, Chicken, Rice`;
  VitaminC.innerHTML = `Citrus fruits, Bell peppers, Strawberries, Broccoli`;
  VitaminD.innerHTML = `Fatty fish, Fortified foods (e.g., milk, orange juice), Sun exposure`;
  VitaminE.innerHTML = `Nuts, Seeds, Vegetable oils, Green leafy vegetables`;
  VitaminK.innerHTML = `Green leafy vegetables (e.g., kale, spinach), Broccoli, Brussels sprouts`;
}

// About Us

function createAboutPage() {
  clearPage();
  const h1 = createEle("h1");
  h1.textContent = "About Us";
  h1.classList.add("title");
  container.append(h1);

  const p = createEle("p");
  p.classList.add("description");
  p.textContent =
    "Welcome to Organic Food, your go-to hub for all things organic and nutritious! We're passionate about offering the freshest, most nutrient-rich organic foods while providing detailed insights into their vitamin content. From vitamin C-packed fruits to calcium-rich greens, each item is carefully sourced from trusted organic farmers who share our commitment to quality and sustainability. Join us on this journey toward a healthier, happier you. Explore our selection, discover the nutritional benefits, and embrace a vibrant life with Organic Food.";

  container.append(p);
}

home.addEventListener("click", createHomePage);
menu.addEventListener("click", createMenuPage);
about.addEventListener("click", createAboutPage);

